//////////////////////////////////////////////////////
//========= Encrypt, Decrypt State feature =========//
//////////////////////////////////////////////////////


function encryptState(data, key) {
    let hashEngine = crypto.createHash("sha256");
    let hashKey = hashEngine.update(key).digest();

    let bytes = aes.utils.utf8.toBytes(data);
    let aesCtr = new aes.ModeOfOperation.ctr(hashKey);
    let encryptedData = aesCtr.encrypt(bytes);

    return aes.utils.hex.fromBytes(encryptedData);
}

function decryptState(data, key) {
    let hashEngine = crypto.createHash("sha256");
    let hashKey = hashEngine.update(key).digest();

    let encryptedBytes = aes.utils.hex.toBytes(data);
    let aesCtr = new aes.ModeOfOperation.ctr(hashKey);
    let decryptedData = aesCtr.decrypt(encryptedBytes);

    return JSON.parse(aes.utils.utf8.fromBytes(decryptedData));
}

//////////////////////////////////////////////////////////
//========= Find and get variable from Config =========//
/////////////////////////////////////////////////////////

var configValue;
try {
    global.client.configPath = join(global.client.mainPath, "config.json");
    configValue = require(global.client.configPath);
    logger.loader("Found file config: config.json");
}
catch {
    if (existsSync(global.client.configPath.replace(/\.json/g, "") + ".temp")) {
        configValue = readFileSync(global.client.configPath.replace(/\.json/g, "") + ".temp");
        configValue = JSON.parse(configValue);
        logger.loader(`Found: ${global.client.configPath.replace(/\.json/g, "") + ".temp"}`);
    }
    else return logger.loader("config.json not found!", "error");
}

try {
    for (const key in configValue) global.config[key] = configValue[key];
    logger.loader("Config Loaded!");
}
catch { return logger.loader("Can't load file config!", "error") }

const { Sequelize, sequelize } = require("./includes/database");

writeFileSync(global.client.configPath + ".temp", JSON.stringify(global.config, null, 4), 'utf8');

/////////////////////////////////////////
//========= Load language use =========//
/////////////////////////////////////////

const langFile = (readFileSync(`${__dirname}/languages/${global.config.language || "en"}.lang`, { encoding: 'utf-8' })).split(/\r?\n|\r/);
const langData = langFile.filter(item => item.indexOf('#') != 0 && item != '');
for (const item of langData) {
    const getSeparator = item.indexOf('=');
    const itemKey = item.slice(0, getSeparator);
    const itemValue = item.slice(getSeparator + 1, item.length);
    const head = itemKey.slice(0, itemKey.indexOf('.'));
    const key = itemKey.replace(head + '.', '');
    const value = itemValue.replace(/\\n/gi, '\n');
    if (typeof global.language[head] == "undefined") global.language[head] = new Object();
    global.language[head][key] = value;
}

global.getText = function (...args) {
    const langText = global.language;
    if (!langText.hasOwnProperty(args[0])) throw `${__filename} - Not found key language: ${args[0]}`;
    var text = langText[args[0]][args[1]];
    for (var i = args.length - 1; i > 0; i--) {
        const regEx = RegExp(`%${i}`, 'g');
        text = text.replace(regEx, args[i + 1]);
    }
    return text;
}

try {
    var appStateFile = resolve(join(global.client.mainPath, global.config.APPSTATEPATH || "appstate.json"));
    let raw = fs.readFileSync(appStateFile, 'utf8');
    try {
        var appState = require(appStateFile);
        logger(global.getText("mirai", "foundVanillaState"), '[ MAIN ]');
        if (process.env.KEY) {
            logger(global.getText("mirai", "processCrypt"), '[ MAIN ]');
            let es = encryptState(raw, process.env.KEY);
            fs.writeFileSync(appStateFile, es);
            logger(global.getText("mirai", "cryptSuccess"), '[ MAIN ]');
        }
    }
    catch (_) {
        if (process.env.KEY) {
            try {
                var appState = decryptState(raw, process.env.KEY);
                var s = (global.config.language == "vi") ? "Đã giải mã appstate bị mã hóa" : "Found encrypted appstate and decrypted successfully";
                logger(s, '[ MAIN ]');
            } catch (e) {
                logger(global.getText("mirai", "fail2crypt1"), "error");
            }
        }
        else {
            logger(global.getText("mirai", "fail2crypt2"), "error");
        }
    }
}
catch { return logger(global.getText("mirai", "notFoundPathAppstate"), "error") }

